import Logo from './Logo';
import BestPokemon from './BestPokemon';
import CaughtPokemon from './BestPokemon';

function App() {
	return (
		<div>
			<Logo />
			<BestPokemon />
			<CaughtPokemon />
		</div>
	);
}






export default App;
